            fontFamily: "Courier-Bold",
          }}
        >
          Add Members
        </Text>
        <View>
          <TextInput style={[styles.textBox1]}></TextInput>
        </View>
        <View style={styles.text}>
          <TouchableOpacity>
            <Button
              onPress={() => navigation.navigate("Meeting", {
                  People: people,
              })}
              title="Submit"
              color="#007AFF"
            />
          </TouchableOpacity>
        </View>
        <Text
          style={{
            textAlign: "left",
            fontSize: 30,
            marginTop: '10%',
            color: "#468DC6",
            fontFamily: "Courier-Bold",
          }}
        >

        </Text>
      </View>
    );
}
export default People;
const styles = StyleSheet.create({
  container: {
